import React from "react";
import { useUserSession } from "./context.user-context";
import { UserSessionContext } from "../context/user-context";

const ProfileNav = () => {
  const { user } = userUserSession();

  function onClick(e) {
    e.preventDefault();
  }

  return (
    <ul class="navbar-nav">
      <li className="nav-item">
        <span className="navbar-text"> Welcome {user.displayName}</span>
      </li>
      {!user._guest && (
        <li className="nav-item">
          <a className="nav-link" href="#" oncClick={onClick}>
            log out
          </a>
          >
        </li>
      )}
    </ul>
  );
};

const NavBar = () => (
  <div className="navba">
    <div className="container">
      <ProfileNav />
    </div>
  </div>
);
